import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Navbar, Container, Nav, NavDropdown, Button, Form, Card, Badge, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './LogIn.css';

const LogIn = () => {
  return (
    <div>
      <header className="App-header">

        <h1 class="mb-4">Log In</h1>

        <Card style={{ color: "#000" }}>
          {/* <Card.Img src= {logo} /> */}
          <Card.Body>
          <Form >
          <Form.Group>
            <Form.Label>Email Address</Form.Label>
            <Form.Control className="emailControl" type="email" placeholder="email@email.com" />
          </Form.Group>
          <Form.Group>
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          <div class="btn-group d-flex mt-3 mb-2" role="group" aria-label="...">
            {/* <button type="button" class="btn btn-default w-100">Left</button> */}
            <Button className="loginButton mt-3 btn-block  w-90" variant="primary" type="submit"> Login </Button>
            {/* <Button className="loginButton mt-3 btn-block w-90" variant="success" type="submit"> Register </Button> */}
          </div>
          </Form>
            <Card.Text>
              We fly your pets, not you.
            </Card.Text>
          </Card.Body>  
        </Card>
      </header>
    </div>

  )
}

export default LogIn
